import React from 'react';
import './content_review.css';
import CardFeaturs from './card_content/cardFeature/card_content_feature';
import CardReviews from './card_content/cardReviews/cardReviews';

class ContentReview extends React.Component{
  render(){
    return(
      <div id="contentreview">
        <CardFeaturs/>
        <CardReviews/>
      </div>
    )
  }
}
export default ContentReview
